Front-End
The front-end of a web application contains everything the user sees when they load up your site. The front-end for this project is a React app.
React
React is a JavaScript library for building user interfaces.
JSX
React uses JSX - this is basically a way to stick HTML directly into JavaScript code! Most React components will ultimately return a bit of JSX, usually including some custom dynamic logic or data.
It ends up looking something like this:
function HomePage(props) {
  const userName = props.name;

  // This function returns a piece of JSX
  return (

      Welcome!
      You're my best friend, {userName} ðŸ˜Š
      Find a Table

  );

};

Component-Based
React is component-based, which means that developers basically create their own custom HTML elements! These elements are called components, and their behavior is defined with JavaScript code.
It ends up looking something like this:
// Creates a component named , with a property of name
function Welcome(props) {
  const name = props.name;

  return Hello, {name};
}

// Creates another component named  that uses the  component
function App() {
  return (





  );
}

In this example,  would render in HTML as:

  Hello, Sara
  Hello, Beatrice
  Hello, George Washington


Guidance
There are some good ways to get started learning React. Most of them assume a basic knowledge of JavaScript, so make sure you have that before moving forward!

Tutorial: This tutorial runs through everything fairly quickly - it's good if you want to get started quickly!
The tutorial mostly uses class components; however, most code in the UCT Locator front-end uses functional components.


Documentation: This documentation is more in-depth, and provides a more comprehensive view of React.

Feel free to jump around between the different pieces of guidance, and perhaps even the UCT Locator code itself!
Library: MUI
Material UI is a library of React UI components. Essentially, there are a bunch of nice-looking pieces of functionality that can plug right into a React application!
If you're planning to use some HTML element in your code, you will want to check if there is an MUI component that already exists. For example, instead of using the basic HTML  element, you could use the MUI :
import * as React from 'react';
import Button from '@mui/material/Button';

function App() {
  return Hello World;
}

Note the import statement that pulls the  from the @mui package!
Library: Axios
Axios is a library that helps React apps make HTTP requests. Basically, this is how the front-end will retrieve data from the back-end, or send data to the back-end. It looks something like this:
try {
  let response = await axios.get("api/tables/all");
  setTableLocations(response.data);
} catch (e) {
  alert("Something wrong with getting tables");
  console.log(e);
}

Axios is promise-based, so most of the UCT Locator code uses async/await to handle these functions. For the UCT Locator front-end, the library can be included with an import statement like this:
import axios from "../../axiosRequests";

